import { About, Home } from "./Home.js"
import { Contact, Notice } from "./contact.js";





function App4() {
    return (
        <div>
            <Router>
                <ul>
                    <li>
                        <Link to="./a">home</Link>
                        <Link to="./b">about</Link>
                        <Link to="./c">servises</Link>
                        <Link to="./d">contacted us</Link>
                    </li>

                </ul>
                <Routes>
                    <Route path="/a" element={<home />}></Route>
                    <Route path="/b" element={<about />}></Route>
                    <Route path="/c" element={<services />}></Route>
                    <Route path="/d" element={<Contact us />}></Route>

                </Routes>
            </Router>
        </div>
    )

}
export default App4;
